def eliminate_duplicates(nums):
    counter = {}
    unique_elements = []
    for num in nums:
        if num in counter:
            unique_elements.append(num)
        counter[num] = counter.get(num, 0) + 1
    eliminated_elements = {k: v - 1 for (k, v) in counter.items() if v > 1}
    return (unique_elements, eliminated_elements)

